(6, 'Shah Shafiur Jalal', 'drr.shafi@gmail.com', 'Rotary International', 'District Rotaract Representative', 'Trustable & Expert in Interior Design. Our office is designed by them. We are satisfied.', 5, 1, '2022-11-07 13:43:48'),
(8, 'Gm Awal Azom', 'awalazom@gmail.com', 'Rotary International', 'Chief Executive Officer', 'A great contractor and architect, Nirman  the team do a great job organizing and planning the jobs to make everyone’s experience more efficient.', 5, 1, '2022-11-07 13:43:48'),
(9, 'Md Raju', 'rajubusiness@gmail.com', 'Rotary International', 'Chief Technology Officer', 'It was an absolute pleasure working with Nirman Architecture. Nirman was very professional and great to work with! They exceeded my expectations and will definitely be working with them again in the future. Highly recommend !!', 5, 1, '2022-11-07 13:43:48'),
(10, 'Shuvo Sarowar', 'sarowararc@gmail.com', 'Rotary International', 'Managing Director', 'We\'ve been working with Nirman Architecture and Construction for years and they are honest, processional, easy to deal with ... Nirman and all his team are amazing! We  are privileged to work with this company.', 5, 1, '2022-11-07 13:43:48'),
(11, 'Salam Muktahim', 'arcmuktahim@gmail.com', 'Rotary International', 'Managing Director', 'Quick and concise communicators. Explores and provides options before final design. Innovative and professional staff. Would do business with again.', 5, 1, '2022-11-07 13:43:48'),
(12, 'Shanto', 'shantoislam0006666@gmail.com', 'North Westers Univer', 'Civil Engineering Student', 'Great working system.', 5, 1, '2024-08-20 11:21:33');
